<template>
  <div>
    <liuchengtu />
    <svgtu />
    <liudongbiankaung />
    base64
    <img :src="imgurl" alt="" width="200px" height="200px" />
    <button @click="downImg">下载截图</button>
    <img
      referrer="no-referrer|origin|unsafe-url"
      :src="testUrl"
      width="300px"
      height="200px"
      alt=""
    />
  </div>
</template>

<script>
import liuchengtu from './components/liuchengtu.vue'
import svgtu from './components/svgtu.vue'
import liudongbiankaung from './components/liudongbiankaung.vue'
import html2canvas from 'html2canvas'
export default {
  name: 'JjjjImagePage',
  components: {
    liuchengtu,
    svgtu,
    liudongbiankaung
  },
  data() {
    return {
      testUrl:
        'http://gips0.baidu.com/it/u=1690853528,2506870245&fm=3028&app=3028&f=JPEG&fmt=auto?w=1024&h=1024',
      imgurl:
        'data:image/png;base64,'
    }
  },

  mounted() {},

  methods: {
    downImg() {
      html2canvas(document.getElementById('imgBox'), {
        backgroundColor: null, //画出来的图片有白色的边框,不要可设置背景为透明色（null）
        useCORS: true, //支持图片跨域
        scale: 1 //设置放大的倍数
      }).then((canvas) => {
        //截图用img元素承装，显示在页面的上
        // let img = new Image()
        // img.src = canvas.toDataURL('image/jpeg') // toDataURL :图片格式转成 base64
        // document.getElementById('yyy').appendChild(img)

        //如果你需要下载截图，可以使用a标签进行下载
        let a = document.createElement('a')
        a.href = canvas.toDataURL('image/jpeg')
        a.download = 'pic'
        a.click()

        //如果需要将图传入后台
        let url = canvas.toDataURL('image/jpeg') //参数里存储的是图片的BASE64码
        console.log(url, 'url')
      })
    }
  }
}
</script>

